import { Header } from './components/Header.js';
import './App.css';
import { Balance } from './components/Balance.js';
import { Income } from './components/Income.js';

function App() {
  return (
    <div>
      <Header />
      <div className='container'>
        <Balance />
      </div>
      <Income />
    </div>
  );
}

export default App;
